           <div className="card-header">
                    <h4>To Do List App</h4>
                </div>
                <div className="card-body">
                    <div className="row">
                        <div className="col-8">
                         <input type="text" className="form-control" placeholder="Search"/>
                        </div>
                        <div className="col-4">
                           <button className="btn btn-primary btn-lx">Add</button>
                        </div>
                    </div>
               </div>
            </div>
     </div>
      
        );
    }
}

export default ToDo;
